import React, { Component } from 'react';
import axios from "axios";
import {Link} from "react-router-dom";


class ContactEmail extends Component {

    constructor(props){
        super(props);
        this.state={linkUserId:'' , userData:{} }
    }

    static getDerivedStateFromProps(nextProps){
        return {userData: nextProps.match.params.email }
    }

    componentDidMount(){
    }

    componentDidUpdate(){
        return true;
    }

    back=()=>{
        console.log(this.props.history , 'rout history');
        this.props.history.push('/contact/:ID');
    };

    render() {

        return (
            <div className="">
                email:{this.state.userData.email}<br/>
                <input type='button' value='Back' onClick={this.back}/>
            </div>
        );
    }
}

export default ContactEmail;
